describe("jasmine.util",function(){describe("extend",function(){it("should add properies to a destination object ",function(){var e={baz:"baz"};jasmine.util.extend(e,{foo:"foo",bar:"bar"}),expect(e).toEqual({foo:"foo",bar:"bar",baz:"baz"})}),it("should replace properies that already exist on a destination object",function(){var e={foo:"foo"};jasmine.util.extend(e,{foo:"bar"}),expect(e).toEqual({foo:"bar"}),jasmine.util.extend(e,{foo:null}),expect(e).toEqual({foo:null})})}),describe("isArray_",function(){it("should return true if the argument is an array",function(){expect(jasmine.isArray_([])).toBe(!0),expect(jasmine.isArray_(["a"])).toBe(!0)}),it("should return false if the argument is not an array",function(){expect(jasmine.isArray_(undefined)).toBe(!1),expect(jasmine.isArray_({})).toBe(!1),expect(jasmine.isArray_(function(){})).toBe(!1),expect(jasmine.isArray_("foo")).toBe(!1),expect(jasmine.isArray_(5)).toBe(!1),expect(jasmine.isArray_(null)).toBe(!1)})})});